function Header() {
  return (
    <header className="header">
      <h1>Abraham Olamilekan Owoyele</h1>
      <p>Backend Developer | Python | FastAPI</p>
      <nav>
        <a href="#projects">Projects</a>
        <a href="#contact">Contact</a>
      </nav>
    </header>
  );
}
export default Header;
